import React from "react";
import { Button } from "@ya.praktikum/react-developer-burger-ui-components";

const MyAppTest = () => {
  return (
    <div>
      <Button htmlType="button" type="primary" size="medium">
        Нажми на меня
      </Button>
    </div>
  );
};

export default MyAppTest;
